<span class="line"><span style="color:#6A9955;"> * . 匹配除换行符（\\n、\\r）之外的任何单个字符。要匹配包括 &#39;\\n&#39; 在内的任何字符，请使用像&quot;(.|\\n)&quot;的模式,\\r表示回车。</span></span>
