<span class="line"><span style="color:#9CDCFE;">console</span><span style="color:#D4D4D4;">.</span><span style="color:#DCDCAA;">log</span><span style="color:#D4D4D4;">(</span><span style="color:#D16969;">/a</span><span style="color:#D7BA7D;">{1,3}</span><span style="color:#D16969;">/</span><span style="color:#D4D4D4;">.</span><span style="color:#DCDCAA;">exec</span><span style="color:#D4D4D4;">(</span><span style="color:#CE9178;">&#39;aaaaa&#39;</span><span style="color:#D4D4D4;">)); </span><span style="color:#6A9955;">// [&#39;aaa&#39;, index: 0, input: &#39;aaaaa&#39;, groups: undefined]</span></span>
